import React, {Component, Fragment} from 'react';
import instance from '../../services/tokenprovider';

export class GetStatistics extends Component {
    constructor(props){
        super(props);
        this.state = {
            statistics:{}
        }
    }

    componentDidMount(){
        instance.get('getstatiscs')
        .then(result => {
            this.setState({statistics:result.data})
            console.log(result)
        })
    }

    render(){
        const {statistics} = this.state;
        return(
            <Fragment>
                <div class = 'container'>
                    <div class = 'row'></div>
                <p>{statistics.allItems}</p>
                <p>{statistics.unCompleteItems}</p>
                <p>{statistics.completeItems}</p>
                </div>
            </Fragment>
        )
    }
}

export default GetStatistics;
